script: |
  super -f text -I q9499.spq | sort > q9499.out

inputs:
  - name: q9499.spq
    data: |
      SELECT ( + + col0 ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 - + col1 NOT IN ( CAST ( + + 54 AS INTEGER ) * + col1 * + col2 * - 66, 44 + + col2, + col2 );
  - name: tab0

outputs:
  - name: q9499.out
    data: |
